import axios from "axios";
import { quoteUrl, apiKey, apiHost } from "../config.json";

export function getQuote(content) {
  const apiEndpoint =
    quoteUrl +
    "/US" +
    "/" +
    content.currency +
    "/en-US" +
    "/" +
    content.origin +
    "/" +
    content.destination +
    "/" +
    content.outbound;
  const response = axios({
    method: "GET",
    url: apiEndpoint,
    headers: {
      "x-rapidapi-host": apiHost,
      "x-rapidapi-key": apiKey
    }
  });
}
